// src/pages/AlbumDetails.jsx
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import {
  getAlbumDetails,
  getAlbumTracks, // si besoin
} from '../services/spotifyService';
import AddAlbumToPlaylistModal from '../components/AddAlbumToPlaylistModal';
import './AlbumDetails.css';

const AlbumDetails = () => {
  const { id } = useParams(); // identifiant de l'album
  const [album, setAlbum] = useState(null);
  const [tracks, setTracks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    const fetchAlbum = async () => {
      setLoading(true);
      try {
        // On récupère un objet album avec éventuellement .tracks.items
        const albumData = await getAlbumDetails(id);
        setAlbum(albumData);

        // Vérifie si albumData.tracks.items est disponible
        if (albumData.tracks && albumData.tracks.items) {
          setTracks(albumData.tracks.items);
        } else {
          // Optionnel : si l'API ne renvoie pas les pistes,
          // vous pouvez appeler getAlbumTracks(id) pour les récupérer
          const trackData = await getAlbumTracks(id);
          setTracks(trackData);
        }
      } catch (error) {
        console.error("Erreur lors de la récupération de l'album :", error);
      } finally {
        setLoading(false);
      }
    };
    fetchAlbum();
  }, [id]);

  const formatDuration = (durationMs) => {
    const minutes = Math.floor(durationMs / 60000);
    const seconds = Math.floor((durationMs % 60000) / 1000);
    return `${minutes}:${seconds < 10 ? "0" : ""}${seconds}`;
  };

  if (loading) {
    return <div className="album-details loading-state">Chargement...</div>;
  }

  if (!album) {
    return <div className="album-details error-state">Album non trouvé.</div>;
  }

  // Calcule la durée totale
  const totalDuration = tracks.reduce((sum, track) => sum + track.duration_ms, 0);

  return (
    <div className="album-details">
      <header className="album-header">
        <div className="album-cover">
          <img
            src={album.images?.[0]?.url || '/default-album.png'}
            alt={album.name}
          />
        </div>
        <div className="album-info">
          <h1 className="album-name">{album.name}</h1>
          {album.artists && (
            <p className="album-artist">
              {album.artists.map((artist) => artist.name).join(', ')}
            </p>
          )}
          <p className="album-meta">
            {tracks.length} chansons – Durée totale : {formatDuration(totalDuration)}
          </p>
          {album.label && (
            <p className="album-label">Label : {album.label}</p>
          )}
          {/* Si l'API Spotify renvoie album.description, on l'affiche */}
          {album.description && (
            <p className="album-description">{album.description}</p>
          )}

          {/* Bouton pour ajouter l'album à une playlist */}
          <button
            className="add-album-btn"
            onClick={() => setShowModal(true)}
          >
            Ajouter cet album à une playlist
          </button>
        </div>
      </header>

      <section className="album-tracks">
        <h2 className="tracks-title">Liste des chansons</h2>
        <ul className="tracks-list">
          {tracks.map((track, index) => (
            <li key={track.id} className="track-item">
              <span className="track-index">{index + 1}.</span>
              <span className="track-name">{track.name}</span>
              <span className="track-duration">{formatDuration(track.duration_ms)}</span>
            </li>
          ))}
        </ul>
      </section>

      {showModal && (
        <AddAlbumToPlaylistModal
          album={album}   // Si besoin du nom de l'album dans le modal
          tracks={tracks} // Liste des pistes
          onClose={() => setShowModal(false)}
        />
      )}
    </div>
  );
};

export default AlbumDetails;
